export function getDate() {
    var date = new Date();
    var dateString = date.toString();
    var weekDay = dateString.slice(0,3);
    console.log(dateString);
    var month = dateString.slice(4,7);
    var day = dateString.slice(8,10);
    var year = dateString.slice(11,16);
    console.log(weekDay);
    console.log(month);
    console.log(day);
    console.log(year);
};
